import React from 'react'
import styles from './Game.module.css'

export default class Game extends React.Component{
    constructor(props){
        super(props)
        this.state = {
           position:'Dealer'
        }
    }
    render(){
        return(
            <div>         
                   <h3> Your now playing as {this.state.position}</h3>
            <div className={styles.gamecontainer}>
             <h3>Enter a number between 1 - 3</h3>
                <input className={styles.gameinput}></input>
                <br></br>
                <br></br>
                <center><button>Submit</button></center>
            </div>
            </div>
        )
    }
}
